import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router> {/* ← Good: Only one Router */}
      <Routes> {/* ← Good: Only one Routes container */}
        <Route path="/" element={<Home />} /> {/* ← Good: Individual route */}
        <Route path="/login" element={<Login />} /> {/* ← Good: Individual route */}
        <Route path="/register" element={<Register />} /> {/* ← Good: Individual route */}
      </Routes>
    </Router>
  );
}
